pragma solidity ^0.8.4;

contract MatrixStorage {

    string[][] private data;

    constructor() public {}

    function uploadData(string[][] memory _data) public {
        data = _data;
    }

    function viewData() public view returns(string[][] memory) {
        return data;
    }
}
